// SPDX-License-Identifier: GPL-2.0-or-later
pragma solidity ^0.8.0;

import "./Marketor/IMarketorV1Events.sol";
import "./Marketor/IMarketorV1Immutables.sol";
import "./Marketor/IMarketorV1MarketCreatorActions.sol";
import "./Marketor/IMarketorV1State.sol";

/// @title The interface for a Uniswap V3 Pool
/// @notice A Uniswap pool facilitates swapping and automated market making between any two assets that strictly conform
/// to the ERC20 specification
/// @dev The pool interface is broken up into many smaller pieces
interface ITTSwapV1Marketor is
    IMarketorV1Events,
    IMarketorV1Immutables,
    IMarketorV1MarketCreatorActions,
    IMarketorV1State
{

}

Contracts/interfaces/Marketor/IMarketorV.content:
// SPDX-License-Identifier: GPL-2.0-or-later
pragma solidity ^0.8.0;

/// @title Pool state that can change
/// @notice These methods compose the pool's state, and can change with any frequency including multiple times
/// per transaction
interface IMarketorV1State {
    function isValidMarketor() external view returns (bool);

    function isValidMarketor(address) external view returns (bool);
}

// SPDX-License-Identifier: GPL-2.0-or-later
pragma solidity ^0.8.0;

/// @title Permissioned pool actions
/// @notice Contains pool methods that may only be called by the factory owner
interface IMarketorV1MarketCreatorActions {
    function setMarketorByMarketCreator(address _owner) external;

    /// @notice Explain to an end user what this does
    /// @dev Explain to a developer any extra details
    function delMarketorByMarketCreator(address _owner) external;
}

// SPDX-License-Identifier: GPL-2.0-or-later
pragma solidity ^0.8.0;

/// @title Pool state that never changes
/// @notice These parameters are fixed for a pool forever, i.e., the methods will always return the same values
interface IMarketorV1Immutables {

}

// SPDX-License-Identifier: GPL-2.0-or-later
pragma solidity ^0.8.0;

/// @title Events emitted by a pool
/// @notice Contains all events emitted by the pool
interface IMarketorV1Events {
    event e_setMarketorByMarketCreator(address);
    event e_delMarketorByMarketCreator(address);
}

